import {createRouter, createWebHistory} from 'vue-router'
import Home from './views/Home'
import Login from './views/Login'
import Logout from './views/Logout'
import Register from './views/Register'
import VariantList from './views/VariantList'
import addVariant from './views/addVariant'
import Variant from './views/Variant'
import Task1 from './views/Task1'

const routes = [
    {
        path: '/',
        name: 'home',
        component: Home
    },
    {
        path: '/login',
        name: 'login',
        component: Login
    },
    {
        path: '/logout',
        name: 'logout',
        component: Logout
    },
    {
        path: '/register',
        name: 'register',
        component: Register
    },
    {
        path: '/ege',
        name: 'ege',
        component: VariantList,
        children: [
            {
                // path: '/addvariant',
                name: 'addvariant',
                component: addVariant,
                // props: true,
            },
        ],
    },
    {
        path: `/ege/:id/tasks`,
        name: 'variant',
        component: Variant,
        // props: true,
    },
    {
        path: `/ege/:id/1`,
        name: 'task1',
        component: Task1,
        // props: true,
    },
]

const router = createRouter({
    history: createWebHistory(process.env.BASE_URL),
    routes
})

export default router
